import React from "react";
import LoginForm from "../components/LoginForm";
import { Row, Col } from "antd";

const login = () => {
  //로그인을 위한 dummyData

  return (
    <div>
      {" "}
      <Row gutter={8}>
        <Col xs={24} md={6}></Col>
        <Col xs={24} md={12}>
          <LoginForm />
        </Col>
        <Col xs={24} md={6}></Col>
      </Row>
    </div>
  );
};

export default login;
